window.bookSummaryJSON = "<p><b>He wants to rescue her. She wants to escape him.</b></p> <p>Kennedy Lowe was the girl that got away. So when she turns up broken and bruised, I‘m determined to fix things and finally claim the girl I’ve always loved. I’ll tease her. Tempt her. In the end, I’ll make her mine.</p> <p>Conner Jagger was the boy I always wanted. But we’re not the same people anymore, and I don’t know if I can trust him with my heart. He’s unrelenting.</p> <p>Overprotective. In the end, he‘ll wear me down.</p> <p>She might be the broken girl from the Heights, and I might be the guy with the world at his feet, but when someone hurts the people I love...I won’t rest until they pay.</p> <p><i>Torment Her </i>is<i> </i>is book five of the Rebels at Sterling Prep, a possessive, immoral, dark high school bully-romance series.</p>"; 
